import React from 'react';
import './App.scss';
import {Header} from './header-component'
import {Hero} from './Hero-component'
import {ArticleList} from "./article-list";
import {Sidebar} from "./sidebar-component";
import {Court} from "./court-component";
function App() {
    return (
        <div>
            <Header/>
            <Hero/>
            <ArticleList
            exclude ='Court'/>
            <Sidebar/>
            <Court/>
        </div>
    );
}

export default App;
